import './index.scss'
import {DashboardOutlined,FormOutlined,TableOutlined,RobotOutlined,CheckCircleOutlined,WarningOutlined,UserOutlined,HighlightOutlined,MenuUnfoldOutlined,MenuFoldOutlined} from '@ant-design/icons';
import { Menu } from 'antd';
import React, { useState } from 'react';
  
  function getItem(label, key, icon, children, type) {
    return {
      key,
      icon,
      children,
      label,
      type,
    };
  }
  let list = [
    {
      icon: <DashboardOutlined/>,
      id: 1,
      title: "Dashboard",
      url: "/Dashboard",
      children: [
        {
          icon: "",
          title: "分析",
          url: "/dashboard/fenxi",
        },
        {
          icon: "",
          title: "监控",
          url: "/dashboard/jiankong",
        },
        {
          icon: "",
          title: "工作台",
          url: "/dashboard/gongzuo",
        },
      ],
    },
    {
      icon: <FormOutlined/>,
      id: 2,
      title: "表单页",
      url: "/form",
      children: [
        {
          icon: "",
          title: "基础表单",
          url: "/form/jichu",
        },
        {
          icon: "",
          title: "分步表单",
          url: "/form/fenbu",
        },
        {
          icon: "",
          title: "高级表单",
          url: "/dashboard/gaoji",
        },
      ],
    },
    {
      icon: <TableOutlined />,
      id: 3,
      title: "列表页",
      url: "/table",
      children: [
        {
          icon: "",
          title: "搜索列表",
          url: "/table/sousuo",
          children: [
            {
              icon: "",
              title: "文章",
              url: "/table/sousuo/wenzhang",
            },
            {
              icon: "",
              title: "项目",
              url: "/table/sousuo/xiangmu",
            },
            {
              icon: "",
              title: "应用",
              url: "/table/sousuo/yingyong",
            },
          ],
        },
        {
          icon: "",
          title: "查询表格",
          url: "/table/chaxun",
        },
        {
          icon: "",
          title: "标准列表",
          url: "/table/biaozhun",
        },
        {
          icon: "",
          title: "卡片列表",
          url: "/table/卡片",
        },
      ],
    },
    {
      icon: <RobotOutlined />,
      id: 4,
      title: "详情页",
      url: "/xiangqing",
      children: [
        {
          icon: "",
          title: "基础详情页",
          url: "/xiangqing/jichuxiangqing",
        },
        {
          icon: "",
          title: "高级详情页",
          url: "/xiangqing/gaojixiangqingye",
        },
      ],
    },
    {
      icon: <CheckCircleOutlined />,
      id: 5,
      title: "结果页",
      url: "/jieguo",
      children: [
        {
          icon: "",
          title: "成功页",
          url: "/jieguo/success",
        },
        {
          icon: "",
          title: "失败页",
          url: "/jieguo/err",
        },
      ],
    },
    {
      icon: <WarningOutlined />,
      id: 6,
      title: "异常页",
      url: "/abnormal",
      children: [
        {
          icon: "",
          title: "403",
          url: "/abnormal/403",
        },
        {
          icon: "",
          title: "404",
          url: "/abnormal/404",
        },
        {
          icon: "",
          title: "500",
          url: "/abnormal/500",
        },
      ],
    },
    {
      icon: <UserOutlined />,
      id: 7,
      title: "个人页",
      url: "/personage",
      children: [
        {
          icon: "",
          title: "个人中心",
          url: "/personage/usercenter",
        },
        {
          icon: "",
          title: "个人设置",
          url: "/personage/userset",
        },
      ],
    },
    {
      icon: <HighlightOutlined />,
      id: 8,
      title: "图形编辑器",
      url: "/图形",
    },
  ];
  

  
  function NavList(){
    const [collapsed, setCollapsed] = useState(false);
    const toggleCollapsed = () => {
      setCollapsed(!collapsed);
    };
  
    return (
      <div className='left'>
        <Menu
          defaultSelectedKeys={['1']}
          defaultOpenKeys={['sub1']}
          mode="inline"
          inlineCollapsed={collapsed}
          items={items}
        />
        <div className='collapse'
          onClick={toggleCollapsed}
        >
          {collapsed ? <MenuUnfoldOutlined /> : <MenuFoldOutlined />}
        </div>
      </div>
    );
  };
  
  export default NavList;
